import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Booking from "./components/Booking";
import PaperQuestions from "./components/PaperQuestions";
import PaperReview from "./components/PaperReview";
import PaperStart from "./components/PaperStart";
import Public from "./components/Public";
import StudentConsultations from "./components/StudentConsultations";
import StudentHome from "./components/StudentHome";
import StudentRegister from "./components/StudentRegister";
import TutorConsultations from "./components/TutorConsultations";
import TutorRegister from "./components/TutorRegister";

function App() {
  return (
    <div style={{ minWidth: "600px" }}>
      <BrowserRouter>
        <Route exact path="/" component={Public}/>
        <Route exact path="/student" component={StudentHome}>
          <StudentHome />
        </Route>
        <Route exact path="/student/register">
          <StudentRegister />
        </Route>
        <Route exact path="/tutor">
          <TutorConsultations />
        </Route>
        <Route>
          <TutorRegister/>
        </Route>
        <Route path="/student/paper">
          <PaperStart />
        </Route>
        <Route path="student/paper/questions">
          <PaperQuestions />
        </Route>
        <Route path="student/paper/review">
          <PaperReview />
        </Route>
      </BrowserRouter>
      {/* <StudentConsultations/> */}
      {/* <Booking /> */}
    </div>
  );
}

export default App;
